import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "../Register/Register.css";
import axios from "axios";
import { GoogleLogin } from "@react-oauth/google";
import { useDispatch } from "react-redux";
import {loginSuccess} from "../redux/authSlice"
import { useQueryClient } from "@tanstack/react-query";

const Login = () => {
  const [values, setValues] = useState({
    email: "",
    password: "",
  });
  const handleChange = (e) => {
    setValues({ ...values, [e.target.name]: e.target.value });
  };
  const [alert, setAlert] = useState("");
  const [alertType, setAlertType] = useState("");
  const navigate = useNavigate();
  const queryClient = useQueryClient();
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(
        "http://localhost:3001/api/login",
        values
      );
      setAlert(response.data.message);
      localStorage.setItem("token", response.data.token);
      dispatch(loginSuccess());
      queryClient.invalidateQueries(["enroll-status"]);
      navigate("/");
      setAlertType("success");
      setTimeout(() => {
        setAlert("");
      }, 500);
    } catch (error) {
      setAlert(error.response?.data?.message || "Login failed");
      setAlertType("error");
      setTimeout(() => {
        setAlert("");
      }, 500);
    }
  };
  const showAlert = (msg, type) => {
    setAlert(msg);
    setAlertType(type);
    setTimeout(() => {
      setAlert("");
      setAlertType("");
    }, 1000);
  };
  const dispatch = useDispatch();
  const handleGoogleLogin =async (credentialResponse) => {
    try {
      const res = await axios.post(
        "http://localhost:3001/api/google-login",
        {
          credential:credentialResponse.credential,
        }
      );
      localStorage.setItem("token",res.data.token);
      showAlert("Google login successful","success");
      setTimeout(() => {
        dispatch(loginSuccess());
        navigate("/");
      }, 500);
    }
    catch(error){
      showAlert("Google login failed","error");
    }
  };
  
  return (
    <div className="body">
      <div className="Register">
        <Link to="/" type="back" className="backBtn">
          Back
        </Link>
        <h1>Login</h1>
        {alert && <div className={`alert ${alertType}`}>{alert}</div>}
        <form onSubmit={handleSubmit}>
          <div>
            <label htmlFor="email">Email</label>
            <input
              id="email"
              type="email"
              placeholder="Enter Email"
              name="email"
              onChange={handleChange}
            />
          </div>

          <div>
            <label htmlFor="password">Password</label>
            <input
              id="password"
              type="password"
              placeholder="Enter Password"
              name="password"
              onChange={handleChange}
            />
          </div>

          <button type="submit">Login</button>
        </form>
        <div style={{ margin: "15px 0", textAlign: "center" }}>
          <span>OR</span>
        </div>
        <div style={{ display: "flex", justifyContent: "center" }}>
          <GoogleLogin
            onSuccess={handleGoogleLogin}
            onError={() => showAlert("Google Login Failed", "error")}
          />
        </div>
        <div style={{display: "flex", justifyContent: "center",margin: "10px 0", textAlign: "center" }}>
          <p>Don't have an account ?</p>
          <Link to="/Register"  style= {{margin: "15px"}}>Register</Link>
        </div>
      </div>
    </div>
  );
};

export default Login;
